import java.util.*;
public class peekl {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
	       LinkedList list = new LinkedList();  
	        list.add("GeM"); 
	        list.add(4); 
	        list.add("GREY"); 
	        list.add("8");   
	       System.out.println("The initial list is :" + list);  
	       System.out.println("Head of the list : " + list.peekLast());
	}

}
